import React from 'react'
import classNames from "classnames/bind";

import style from "./Home.module.scss"

export default function Home() {
  const cx = classNames.bind(style)

  return (
    <div className={cx("wrapper")}>
      {
    
            <div className="navbar" style={{ width: '100%', height: '60px' }}>
              <Link to="/" className="navbar-brand">Trang Admin</Link>
              <ul className="navbar-nav">
                <li className="nav-item">
                  <Link to="/contracts" className="nav-link">Quản lý Hợp đồng</Link>
                </li>
                <li className="nav-item">
                  <Link to="/orders" className="nav-link">Quản lý Đơn hàng</Link>
                </li>
                <li className="nav-item">
                  <Link to="/users" className="nav-link">Quản lý Người dùng</Link>
                </li>
              </ul>
            </div>
      }
    
    </div>
  )
}
